(1780, '', 'SIRIO 22-10E', 46, 83, 'COMPRESOR DE AIRE A TORNILLO', 'COMPRESOR DE AIRE A TORNILLO\r\nPOTENCIA DEL COMPRESOR: 22 KW - 30 HP				\r\n	CAUDAL: 3050 L/MIN 120 m³/hr				\r\n	PRESION: 10 BAR				\r\n	INTENSIDAD SONORA: 68 Dba				\r\n	CONEXIÓN: 1\"				\r\n	PESO: 380 KG				\r\n	DIMENSIONES: 1350 x800 x1130 ml (L*W*H)				\r\n	CON PANEL DE CONTROL ELECTRONICO:				\r\nCaracterísticas:\r\nEl controlador electrónico ETIV gestiona todas las funciones del compresor y permite la diagnosis del sistema, Funciones de temporizador semanal, auto inicio después de una falla, planificación de mantenimiento, alarmas, varios niveles de alarma, relé de secuencia de fase, que permite el sentido correcto del tornillo.\r\nRegulador de admisión\r\nEl sistema electroneumático que regula el compresor. el funcionamiento asegura la presión mínima requerida\r\ndurante el funcionamiento en vacío y el máximo ahorro de energía en puesta en marcha, mejorando así el coste energético/aire generado relación.\r\nSistema de refrigeración\r\nEl ventilador axial garantiza la temperatura de funcionamiento óptima para el gran intercambiador de aire: operación segura en todas condiciones ambientales, con el mínimo nivel de ruido.\r\nTransmisión confiable\r\nTransmisión entre compresor y motor eléctrico se realiza mediante correas Poly-V, mantenimiento mínimo.\r\nMARCA: NUAIR - ITALIA', '1745503496_download.jpg', ''),
(1781, '', 'LG22-10GA', 47, 83, 'COMPRESOR DE AIRE A TORNILLO', 'COMPRESOR DE AIRE A TORNILLO\r\nPOTENCIA DEL COMPRESOR: 22 KW - 30 HP				\r\n	TIPO DE ACOPLE: ACOPLE DIRECTO				\r\n	CAUDAL: 3.600 l/min 				\r\n	PRESION: 10 BAR				\r\n	INTENSIDAD SONORA: 70 Dba				\r\n	CONEXIÓN: 1\"				\r\n	PESO: 390 KG				\r\n	DIMENSIONES: 1300 x 850 x 1100 mm				\r\nCaracterísticas:\r\nPanel de control electrónico: gestiona todas las funciones del compresor y permite la diagnosis del sistema, Funciones de temporizador semanal, auto inicio después de una falla, planificación de mantenimiento, alarmas, varios niveles de alarma, relé de secuencia de fase, que permite el sentido correcto del tornillo.\r\nVálvula reguladora de admisión\r\nEl sistema electroneumático que regula el compresor.\r\nel funcionamiento asegura la presión mínima requerida durante el funcionamiento en vacío y el máximo ahorro de energía en puesta en marcha, en respuesta al transductor de presión.\r\nMotor de control\r\nMotor  IP54 utiliza grasa de alta calidad que aporta estabilidad a los rodamientos y alarga la vida util ante la corrosión y el polvo.\r\nTransmisión de acople directa\r\nAcople de diseño europeo tipo araña es usada para garantizar la fiabilidad y alta eficiencia en la transmisión y está libre de vibración por la transmisión y de fácil mantenimiento, por lo que se traduce en menos costes de mantenimiento a diferencia de un sistema de correa que se desgasta las correas y poleas con el tiempo.\r\nUnidad compresora\r\nUnida de tornillos premium de alto rendimiento\r\nSistema eléctrico\r\nCon contactores de la marca Sneider.\r\nMARCA: EAGLE - ASIA', '1745503981_download.jpg', ''),
