(1929, '', 'CH2EB100B-400A', 15, 52, 'CILINDRO HIDRAULICO', 'CILINDRO HIDRÁULICO DE DOBLE 		\r\nEFECTO SIMPLE VÁSTAGO		\r\nCaracterísticas Técnicas		\r\nFlujo: Fluido hidráulico\r\nPresión de prueba: 50 bar\r\nMáxima presión admisible: 35 bar\r\nPresión nominal: 35 bar\r\nMínima presión de trabajo: 1.5 bar\r\nTemperatura ambiente y fluido: -10 a 80°C		\r\nVelocidad del pistón: 8 a 300 mm/s\r\nDiámetro del cilindro: 100 mm\r\nCarrera: 400 mm\r\nDiámetro del vástago: 56 mm\r\nRosca del vástago:	M48 x 1,5\r\nFuerza teórica en la salida: 27475 N a 35 bar\r\nFuerza teórica en el ingreso: 18859 N a 35 bar\r\nConexión: 3/4\"\r\nComponentes adicionales y observaciones		\r\nForma de montaje:	Básico\r\nMaterial del tubo: Aleación de aluminio', '1746570687_SMC_CHN_F020_flange__CH_HYDRAULIC_CYLINDER_____04445.jpg', ''),
