(2233, '', 'KT6W-2N5116', 54, 118, '', 'Tipo de sensor: Sensor de contraste con tecnología de detección difusa-reflectiva.\r\nDistancia de detección: 10 mm, con una tolerancia de ±3 mm.\r\nFuente de luz: LED RGB (rojo, verde, azul) con longitudes de onda de 470 nm, 525 nm y 640 nm.\r\nTamaño del punto de luz: 1.5 mm x 6.5 mm.\r\nSalida de conmutación: NPN.\r\nFrecuencia de conmutación: Hasta 5 kHz.\r\nTiempo de respuesta: 100 µs.\r\nTensión de alimentación: 10–30 V DC.\r\nConsumo de corriente: Menos de 40 mA.\r\nConexión: Conector M12 de 4 pines.\r\nMaterial del cuerpo: Metal.\r\nDimensiones: 30.4 mm x 53 mm x 80 mm.\r\nGrado de protección: IP67, adecuado para entornos industriales exigentes.\r\nTemperatura de funcionamiento: De -10 °C a +55 °C.\r\nFunción adicional: Modo de enseñanza estática de 2 puntos (teach-in) para calibración precisa.', '1747148202_OIP.jpg', 'https://www.sick.com/media/pdf/9/59/059/dataSheet_KT6W-2N5116_1046010_en.pdf'),
(2234, '', 'WL27-3P2451', 54, 118, '', 'Principio de funcionamiento: Sensor fotoeléctrico retroreflectivo con sistema de doble lente, que mejora la precisión y reduce errores de detección.\r\nRango de detección: De 0.1 m a 11 m (máximo de 15 m con reflector PL80A).\r\nFuente de luz: LED de luz roja visible (longitud de onda de 660 nm).\r\nTamaño del punto de luz: Diámetro de 220 mm a 10 m de distancia.\r\nAjuste de sensibilidad: Mediante potenciómetro integrado.\r\nSalida de conmutación: PNP con función de conmutación complementaria (modo luz/oscuro seleccionable).\r\nTiempo de respuesta: 500 µs.\r\nTensión de alimentación: 10–30 V DC.\r\nConexión: Conector M12 de 4 pines.\r\nGrado de protección: IP69K, adecuado para entornos industriales exigentes.\r\nDimensiones: 24.6 mm x 80.6 mm x 54 mm.\r\nMaterial del cuerpo: Carcasa robusta de ABS con óptica de PMMA.', '1747148391_OIP.jpg', 'https://www.sick.com/media/pdf/9/19/419/dataSheet_WL27-3P2451_1027770_es.pdf'),
(2235, '', 'WL36-C030S03', 54, 118, '', 'Principio de funcionamiento: Sensor fotoeléctrico retroreflectivo con sistema de doble lente, que mejora la precisión y reduce errores de detección.\r\nRango de detección: De 0.1 m a 15 m (máximo de 15 m con reflector adecuado).\r\nFuente de luz: LED de luz roja visible.\r\nAjuste de sensibilidad: Mediante potenciómetro integrado.\r\nSalida de conmutación: Relé SPDT (Single Pole Double Throw), eléctricamente aislado.\r\nTensión de alimentación: 24–240 V AC/DC.\r\nConexión: Terminal PG11.\r\nGrado de protección: IP67, adecuado para entornos industriales exigentes.\r\nMaterial del cuerpo: Carcasa robusta de plástico reforzado con fibra de vidrio.\r\nTemperatura de funcionamiento: De -25 °C a +55 °C.', '1747148682_FDS.jpg', ''),
