(2267, '', 'E3C-S20W', 59, 122, '', 'Tipo de sensor: Barrera (emisor y receptor separados).\r\nDistancia de detección: Hasta 200 mm (20 cm).\r\nFuente de luz: LED infrarrojo con una longitud de onda de 950 nm.\r\nMétodo de conexión: Cable preconectado de 2 metros.\r\nTemperatura de funcionamiento: De -25 °C a +70 °C (sin congelación ni condensación).\r\nHumedad relativa de funcionamiento: 35% a 85% (sin condensación).\r\nGrado de protección: IP50 según IEC 60529, adecuado para uso en interiores.\r\nMaterial de la carcasa: Policarbonato.\r\nPeso: Aproximadamente 50 g.\r\nResistencia a vibraciones: 10 a 55 Hz, amplitud doble de 1.5 mm durante 2 horas en las direcciones X, Y y Z.\r\nResistencia a impactos: 500 m/s² (aproximadamente 50 G) en cada dirección X, Y y Z', '1747161011_RFCXX.jpg', 'https://www.ia.omron.com/products/family/423/specification.html'),
(2268, '', 'E3JM-R4M4T-G', 59, 122, '', 'Método de detección: Retroreflectivo con función de supresión de fondo (M.S.R.).\r\nDistancia de detección: Hasta 4 metros utilizando el reflector E39-R1.\r\nFuente de luz: LED rojo polarizado (longitud de onda de 660 nm).\r\nTensión de alimentación: 12–240 V DC o 24–240 V AC, ±10%.\r\nSalida de control: Relé SPDT (contacto inversor), con capacidad de conmutación de hasta 3 A a 250 V AC.\r\nModos de operación: Conmutable entre Light-ON y Dark-ON mediante interruptor.\r\nFunción de temporización: Incluye temporizador seleccionable (retardo de encendido, retardo de apagado o pulso único) ajustable entre 0.1 y 5 segundos.\r\nTiempo de respuesta: 30 ms máximo.\r\nConexión: Bloque de terminales con entrada de conducto PG13.5.\r\nMaterial de la carcasa: Plástico ABS con lente de resina de metacrilato.\r\nGrado de protección: IP66, adecuado para entornos industriales exigentes.\r\nTemperatura de funcionamiento: De -25 °C a +55 °C (sin congelación ni condensación).\r\nDimensiones: 25 mm (ancho) x 65 mm (alto) x 75 mm (profundidad).', '1747161115_E3JM-R4_DS70_prduct photo.jpg', 'https://www.ia.omron.com/product/item/68253/'),
(2269, '', 'E6B2-CWZ6C', 59, 123, '', 'Tipo: Codificador rotativo incremental.\r\nDiámetro del cuerpo: 40 mm.\r\nResolución: Disponible en múltiples resoluciones, desde 10 hasta 2,000 pulsos por revolución (PPR) .\r\nFases de salida: Señales A, B y Z (canal de referencia).\r\nTipo de salida: NPN de colector abierto.\r\nTensión de alimentación: 5 a 24 VDC (±5% a +15%), con un rizado máximo de 5% .\r\nConsumo de corriente: Hasta 80 mA.\r\nFrecuencia máxima de respuesta: 100 kHz.\r\nVelocidad máxima permitida: 6,000 revoluciones por minuto (r/min).\r\nCarga del eje: Radial hasta 30 N; axial hasta 20 N.\r\nPar de arranque: 0.98 mN·m máximo.\r\nMomento de inercia: 1 × 10⁻⁶ kg·m² máximo.\r\nProtecciones integradas: Contra inversión de polaridad y cortocircuito de carga.\r\nTemperatura de funcionamiento: De -10 °C a +70 °C (sin congelación).\r\nGrado de protección: IP50 .', '1747161342_FCXER.jpg', 'https://www.ia.omron.com/product/item/2450/'),
(2270, '', 'K8AK-LS1', 59, 124, '', 'Tipo de control: Control de nivel conductivo (funciona como interruptor sin flotador).\r\nModos de operación: Conmutable entre llenado (suministro) y vaciado (drenaje) mediante interruptores DIP.\r\nSensibilidad ajustable: Rango de resistencia de operación de 10 kΩ a 100 kΩ, adaptable a diversos tipos de líquidos.\r\nFunción de retención automática: Implementada internamente sin necesidad de cableado externo adicional.\r\nPrevención de oscilaciones: Diseñado para evitar el parpadeo de los contactos del relé debido a ondulaciones en el líquido.\r\nIndicadores LED: LED verde para alimentación (PWR) y LED amarillo para estado del relé (RY).\r\nSalida de control: Relé SPDT (1 contacto inversor) con capacidad de conmutación de hasta 5 A a 250 V AC o 30 V DC.\r\nTiempo de respuesta: Ajustable entre aproximadamente 0.1 y 10 segundos.\r\nMontaje: Diseñado para montaje en riel DIN de 22.5 mm de ancho.\r\nConexiones: Terminales de tornillo para una conexión segura.\r\nLongitud máxima del cable de electrodos: Hasta 100 metros utilizando cable trifilar totalmente aislado de 0.75 mm² y 600 V.\r\nTemperatura de operación: De -20 °C a +60 °C (sin condensación ni formación de hielo).\r\nHumedad relativa de operación: 25% a 85% (sin condensación).', '1747161532_k8ak-ls1_prod.jpg', 'https://industrial.omron.es/es/products/k8ak-ls'),
